import './toolBar.css';
import Button  from './button';


const Colours = [
    "red",
    "green",
    "blue",
    "white",
    "black"
];

export default function ToolBar(){
    return(
        <div className='tool-bar' draggable = 'True'>
            {Colours.map((colour, index) => (
            <button
                key={index}
                className="colour"
                id={colour}
                style={{ backgroundColor: colour }}
            ></button>
        ))}


        </div>
    );
}
